import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

let postData = [
    {name: 'Eduarda', message:'Hello', likes: '15'},
    {name: 'Artiom', message:'Good morning', likes: '20'}
]

ReactDOM.render(
    <App postData={postData}/>,
  document.getElementById('root')
);
